import React, { Component } from "react";
import {
  Card,
  Image,
  Grid,
  Container,
  Button,
  Transition,
  List,
  Popup
} from "semantic-ui-react";

class NewsArticle extends Component {
  render() {
    return (
      <List.Item>
        <Grid column={2}>
          <Grid.Row>
            <Grid.Column>
              <Image className="newsimage" src={this.props.info.urlToImage} />
            </Grid.Column>
            <Container>{this.props.info.description}</Container>
            <Grid.Column />
          </Grid.Row>
        </Grid>
      </List.Item>
    );
  }
}
export default NewsArticle;
